  0% {
    transform: rotate(360deg);
  }

  100% {
    transform: rotate(0deg);
  }
}

.table {
  position: relative;

  background: $white;
  box-shadow: 0px 2px 4px rgba(0, 0, 0, 0.25);
  border: 1px solid $border-grey;
  border-radius: 0.5rem;

  /* For testing only */
  width: 80vw;
  margin: auto;
  /*------------------*/

  font-family: Cabin;
  font-size: 1.4rem;

  .header,
  .footer {
    padding: 2rem;
  }

  .header {
    color: $grey;
    font-weight: bold;

    border-bottom: 2px solid $light-grey;
  }

  .body {
    color: $black;

    padding: 0 2rem;
    margin: 0 -0.5rem;

    > .row {
      margin: 0 -2rem;
      padding: 0 2rem;

      &:nth-child(2n) {
        background: $lighter-grey;
      }

      > .col-xs {
        padding: 2rem 0.5rem;
      }
