  }

  .footer {
    border-top: 2px solid $light-grey;

    .button {
      transition: color 0.1s ease-in-out, box-shadow 0.15s ease-in-out;
      border-radius: 100%;
      &:focus {
        outline: 0;

        &:not(.disabled) {
          box-shadow: $focus-shadow;
        }
      }
      &:not(.disabled) {
        cursor: pointer;
      }

      &.disabled {
        color: #dadada;
      }
    }

    .button:hover:not(.disabled) {
      color: rgba(0, 0, 0, 0.75);
    }

    .input {
      margin-left: 0.2rem;
      display: inline-block;
      width: 3rem;
    }

    > .left {
      color: $grey;

      .button:hover {
        animation: rotate 2s ease-in-out infinite;
      }

      & > div:last-child {
        margin-left: 1.2rem;
      }
    }

    > .right {
      color: $grey;

      .label {
        margin: 0 1rem;
      }
    }
  }
}
